import React, { Component } from 'react';

class Edu extends Component {
    constructor(props) {
        super(props);

    }

    render() {
        return (
            <section>
            <div>
            <div className="serviceheader">
                    <h1 className="text-center" id="servicehead"> Education</h1>
                    <div className="underlineedu text-center"></div>
                    </div>
                    <div className="container">
                            <div className="col-md-12">
                            <div className="text-center">
                                <li>SCL at Shree Nuwar Subedi Thar Higher Secondary School, Kushma municipality 01 pang</li>
                                <li>+2 at Shree Himalaya Higher Secondary School, kushma municipality 02 Khurto</li>
                                <li>Information Technology2 at Internation School of management & technology </li>
                            </div>
                            </div>
                    </div>
                </div>
                </section>
        );
    }
}



export default Edu;
